B.C6=s(["\ud83d\udd39 Project Overview:","A Flutter-based web application developed as a graduation project, aimed at supporting decision-making for poverty alleviation initiatives in Egypt. The system serves as a centralized digital platform that collects, organizes, and visualizes critical data about the country\u2019s poorest villages. It empowers government entities, NGOs, and investors with real-time, data-driven insights to make informed decisions and effectively target aid and development efforts.","","\ud83d\udd39 Key Features:","1- Interactive dashboards showcasing real-time statistics, charts, and maps.","2- Data visualization of poverty indicators such as education, healthcare access, and infrastructure.","3- Centralized database for storing village-level data using Firebase Firestore.","4- REST API integration to fetch and update live data.","5- User-friendly interface with responsive design for accessibility across devices.","6- Role-based access control for administrators, researchers, and decision-makers.","7- Insightful analytics to highlight areas of urgent need and potential impact.","","\ud83c\udfc6 Achievement:","Received Distinction (A) for innovation, technical execution, and social impact.","","\ud83d\udd39 Tech Stack:","Flutter Web for frontend development.","Firebase (Auth + Firestore) for backend and real-time data handling.","Firebase Auth for user login/registration.","REST APIs for external data integration.","Chart libraries (e.g., fl_chart) for data visualization.","Provider for state management."],t.s)
